import React, { Component } from 'react';
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';
import './App.css';
import Skills from './pages/Skills';
import Home from './pages/Home';

class App extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <Router>
        <div className="App">
          <nav className="Navi">
            <ul>
              <li>
                <Link to="/">Home</Link>
              </li>
              <li>
                <Link to="/skills">Skills</Link>
              </li>
            </ul>
          </nav>

          <Switch>
            <Route path="/skills">
              <Skills />
            </Route>
            <Route path="/">
              <h1>THIS IS HOME</h1>
            </Route>
          </Switch>
        </div>
      </Router>
    );
  }
}

export default App;
